div.script:
let isTouched = false;
function fakeUsage() {
	let time = Date.now();
	let cumulated = 0;
	function easeInOutSine(x) {
		return -(Math.cos(Math.PI * x) - 1) / 2;
	}
	function easeInOutCubic(x) {
		return x < 0.5 ? 4 * x * x * x : 1 - Math.pow(-2 * x + 2, 3) / 2;
	}
	function loop() {
		const now = Date.now();
		const delta = now - time;
		cumulated += delta;
		time = now;
		const currentScreen = document.querySelector('[data-screen-current]');
		if (currentScreen) {
			const factor = cumulated / 15_000; 
			const bezierFactor = easeInOutSine(factor);
			currentScreen.scrollTop = (currentScreen.scrollHeight - currentScreen.clientHeight) * bezierFactor;
			if (factor >= 1) {
				cumulated = 0;
				changeScreen(currentScreen);
			}
		}
		if (!isTouched) window.requestAnimationFrame(loop);
	}
	loop();
}
function changeScreen(touchedScreen) {
	const screens = Array.from(document.querySelectorAll('[data-screen]'));
	const overlays = Array.from(document.querySelectorAll('[data-overlay]'));
	const idx = screens.findIndex(s => s === touchedScreen);
	for (let i=0; i {
	screen.addEventListener('click', () => {
		isTouched = true;
		changeScreen(screen);
	});
	screen.addEventListener('mouseover', (e) => {
		isTouched = true;
	});
});
fakeUsage();

