    let loggedIn = false;
    let initialOffsetFilters = 0;
    let urlSearchParams = new URLSearchParams(window.location.search);
    const params = Object.fromEntries(urlSearchParams.entries());
    let clientId = params["clientId"];
    let partnerId = params["partnerId"];
    let username = params["username"];
    $(document).ready(function () {
        if ($('#headerUserLayerAnnymousLoginFormWrapper').length != 1) {
            loggedIn = true;
        }
        if (loggedIn == false) {
            $('.header').after(loginBar);
            if ($('.shadow')) {
                $('.shadow').css('box-shadow', 'none');
            }
            $('.sticky-login-bar').css('top', $('#headerSearch').outerHeight());
            initialOffsetFilters = $('#main-sticky-login-bar').offset().top;
            $('#login-method-partner').on('click', function () {
                $('#login-partner-form').addClass('d-lg-block').show();
                $('#login-username-form').removeClass('d-lg-block').hide();
                $('#login-method-partner').removeClass('muted');
                $('#login-method-username').addClass('muted');
            });
            $('#login-method-username').on('click', function () {
                $('#login-partner-form').removeClass('d-lg-block').hide();
                $('#login-username-form').addClass('d-lg-block').show();
                $('#login-method-partner').addClass('muted');
                $('#login-method-username').removeClass('muted');
            });
            $('.sign-in-btn').on('click', function () {
                if (getWindowWidth() < 768) {
                    $('.nav-mobile-toggle').click();
                    setTimeout(function () {
                        $('#mobileMegaMenuLoginArea .menu-item').click();
                    }, 100);
                }
                else {
                    $(document).on("click", ".sign-in-btn", function (e) {
                        e.stopPropagation();
                        $('.header-user-login').dropdown("show");
                    });
                }
            });
            fillLoginForm();
        }
    });
    $(window).resize(function () {
        if (loggedIn === false && $('.sticky-login-bar').is(":visible")) {
            $('.sticky-login-bar').css('top', $('#headerSearch').outerHeight());
        }
    });
    $(window).scroll(function () {
        if (loggedIn === false && $('.sticky-login-bar').is(":visible")) {
            if (Math.floor($('#main-sticky-login-bar').offset().top) > Math.floor(initialOffsetFilters)) {
                $('#login-bar').css('box-shadow', 'rgb(0 0 0 / 23%) 0px 6px 6px')
            }
            else {
                $('#login-bar').css('box-shadow', '');
            }
        }
    });
    function fillLoginForm() {
        if (clientId != '') {
            $('input[name=LoginForm\\.CustomerNumber]').val(clientId);
        }
        if (partnerId != '') {
            $('input[name=LoginForm\\.Login]').val(partnerId);
        }
        if (username != '') {
            $('input[name=LoginWithUserNameForm\\.UserName]').val(username);
        }
    }
    function scrollToElement(element, offset, animation) {
        animationTime = 0;
        if (animation === true) {
            animationTime = 800;
        }
        $([document.documentElement, document.body]).animate({
            scrollTop: element.offset().top - ($('#headerSearch').outerHeight() + offset)
        }, animationTime);
    }
    function getWindowWidth() {
        return Math.max(
            document.documentElement.clientWidth,
            window.innerWidth || 0
        )
    }
