// Swiper
var listeSwiper = document.querySelectorAll(".swiper-hp");
if(listeSwiper.length >= 1) {
	listeSwiper.forEach(function(thisSwiper, i) {
		var container = thisSwiper.parentNode;
		var nextButton = container.querySelector('.swiper-next');
		var prevButton = container.querySelector('.swiper-prev');
		var idNext = 'swiper-next'+i;
		var idPrev = 'swiper-prev'+i;
		if(container.classList.contains('swiper-container') && nextButton) {
			nextButton.setAttribute('id', idNext);
		}
		if(container.classList.contains('swiper-container') && prevButton) {
			prevButton.setAttribute('id', idPrev);
		}
		var swiper = new Swiper(thisSwiper, {
			// Optional parameters
			slidesPerView: "auto",
			speed: 300,
			spaceBetween: 17,
			// Scrollbar
			scrollbar: {
				el: '.swiper-scrollbar',
				draggable: true,
			},
			// Navigation on desktop
			navigation: {
				prevEl: '#'+idPrev,
				nextEl: '#'+idNext,
			},
			breakpoints: {
				0: {
					spaceBetween: 12
				},
				992: {
					spaceBetween: 17
				}
			}
		});
	});
}
